import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Test tss
        </p>
        <a
          className="App-link"
          href="list.js"
          target="_blank"
          rel="noopener noreferrer"
        >
          GO
        </a>
        <Link to="/list" className="App-link"> Eto </Link>
      </header>
    </div>
  );
}

export default App;
